import React from 'react'
import { Container } from 'react-bootstrap'
import {Navbar } from 'react-bootstrap'

export const TopTematica = ({params}) => {

    console.log(params);

    return (
        <Container>
            <Navbar bg="light">
                <ul className="list-inline">
                    {params.Componentes.map(info => (
                        <li>{info.Titulo}</li>
                    ))}
                </ul>
            </Navbar>
        </Container>
    )
}
